import "./Tile.css";

function Tile(props) {

  function handleClick() {
    document.getElementById(props.id).classList.toggle("invisible")
    console.log(props.id);
  }

  return (
    <div className="tile" onClick={handleClick}>
      <h2 id={props.id} class="invisible" >{props.letter}</h2>
    </div>
  );
}

export default Tile;
